import React from 'react';
import { useNavigate } from 'react-router-dom';

function Logout() {
  const navigate = useNavigate();

  const handleLogout = () => {
    // ログアウト処理（例：トークンの削除）
    navigate('/login'); // ログインページに遷移
  };

  return (
    <button onClick={handleLogout}>Logout</button>
  );
}

export default Logout;
